core::slice::<impl [T]>::get_mut.doc:
Returns a mutable reference to an element or subslice depending on the
type of index (see [`get`]) or `None` if the index is out of bounds.

[`get`]: slice::get

# Examples

```
let x = &mut [0, 1, 2];

if let Some(elem) = x.get_mut(1) {
    *elem = 42;
}
assert_eq!(x, &[0, 42, 2]);
```

core::ops::Try::branch.doc:
Used in `?` to decide whether the operator should produce a value
(because this returned [`ControlFlow::Continue`])
or propagate a value back to the caller
(because this returned [`ControlFlow::Break`]).

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, Try};

assert_eq!(Ok::<_, String>(3).branch(), ControlFlow::Continue(3));
assert_eq!(Err::<String, _>(3).branch(), ControlFlow::Break(Err(3)));

assert_eq!(Some(3).branch(), ControlFlow::Continue(3));
assert_eq!(None::<String>.branch(), ControlFlow::Break(None));

assert_eq!(ControlFlow::<String, _>::Continue(3).branch(), ControlFlow::Continue(3));
assert_eq!(
    ControlFlow::<_, String>::Break(3).branch(),
    ControlFlow::Break(ControlFlow::Break(3)),
);
```

core::ops::FromResidual::from_residual.doc:
Constructs the type from a compatible `Residual` type.

This should be implemented consistently with the `branch` method such
that applying the `?` operator will get back an equivalent residual:
`FromResidual::from_residual(r).branch() --> ControlFlow::Break(r)`.
(The residual is not mandated to be *identical* when interconversion is involved.)

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, FromResidual};

assert_eq!(Result::<String, i64>::from_residual(Err(3_u8)), Err(3));
assert_eq!(Option::<String>::from_residual(None), None);
assert_eq!(
    ControlFlow::<_, String>::from_residual(ControlFlow::Break(5)),
    ControlFlow::Break(5),
);
```

core::mem::replace.doc:
Moves `src` into the referenced `dest`, returning the previous `dest` value.

Neither value is dropped.

* If you want to replace the values of two variables, see [`swap`].
* If you want to replace with a default value, see [`take`].

# Examples

A simple example:

```
use std::mem;

let mut v: Vec<i32> = vec![1, 2];

let old_v = mem::replace(&mut v, vec![3, 4, 5]);
assert_eq!(vec![1, 2], old_v);
assert_eq!(vec![3, 4, 5], v);
```

`replace` allows consumption of a struct field by replacing it with another value.
Without `replace` you can run into issues like these:

```compile_fail,E0507
struct Buffer<T> { buf: Vec<T> }

impl<T> Buffer<T> {
    fn replace_index(&mut self, i: usize, v: T) -> T {
        // error: cannot move out of dereference of `&mut`-pointer
        let t = self.buf[i];
        self.buf[i] = v;
        t
    }
}
```

Note that `T` does not necessarily implement [`Clone`], so we can't even clone `self.buf[i]` to
avoid the move. But `replace` can be used to disassociate the original value at that index from
`self`, allowing it to be returned:

```
# #![allow(dead_code)]
use std::mem;

# struct Buffer<T> { buf: Vec<T> }
impl<T> Buffer<T> {
    fn replace_index(&mut self, i: usize, v: T) -> T {
        mem::replace(&mut self.buf[i], v)
    }
}

let mut buffer = Buffer { buf: vec![0, 1] };
assert_eq!(buffer.buf[0], 0);

assert_eq!(buffer.replace_index(0, 2), 0);
assert_eq!(buffer.buf[0], 2);
```

